import { CodeIcon } from "@heroicons/react/solid";
import { projects } from "../data";
import { FaReact, FaGithub, FaUnity, FaVideo, FaNodeJs } from "react-icons/fa";
import { FaMeta } from "react-icons/fa6";
import { SiDjango, SiMysql, SiBlender, SiUnrealengine } from "react-icons/si";
import { RiTailwindCssFill } from "react-icons/ri";
import { GrHeroku } from "react-icons/gr";
import { IoLogoVercel } from "react-icons/io5";
import { AiOutlineOpenAI } from "react-icons/ai";

// Map icon names to actual icon components
import React, { useState } from "react";


const iconComponents = {
  FaReact,
  SiDjango,
  SiMysql,
  SiBlender,
  SiUnrealengine,
  FaUnity,
  FaMeta,
  FaNodeJs,
  RiTailwindCssFill,
  GrHeroku,
  AiOutlineOpenAI,
  IoLogoVercel,
};

const renderIcon = (iconName) => {
  const IconComponent = iconComponents[iconName];
  return IconComponent ? <IconComponent className="text-3xl mx-2" /> : null;
};

export default function Projects() {
  const [visibleSections, setVisibleSections] = useState({});

  const toggleSection = (sectionName) => {
    setVisibleSections((prevState) => ({
      ...prevState,
      [sectionName]: !prevState[sectionName],
    }));
  };

  const schoolProjects = projects.filter(
    (project) => project.category === "School"
  );
  const otherProjects = projects.filter(
    (project) => project.category !== "School"
  );

  return (
    <section id="projects" className="text-gray-800 bg-purple-100 body-font">
      <div className="container px-5 py-10 mx-auto text-center lg:px-40">
        <div className="flex flex-col w-full mb-10">
          <h1 className="sm:text-4xl text-3xl font-medium title-font mb-4 text-gray-800">
            My Projects
          </h1>
          <p className="lg:w-2/3 mx-auto leading-relaxed text-base">
            Explore my projects categorized into school and other development endeavors.
          </p>
        </div>

        {/* School Projects Section */}
        <div className="mb-10">
          <div
            className="cursor-pointer bg-gray-800 rounded-lg p-4 text-purple-100"
            onClick={() => toggleSection("school")}
          >
            <h2 className="text-2xl font-bold">School Projects</h2>
          </div>
          {visibleSections.school && (
            <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6 mt-6">
              {schoolProjects.map((project, index) => (
                <div
                  key={index}
                  className="p-4 bg-gray-800 rounded-lg border border-gray-700"
                >
                  <h2 className="text-lg font-bold text-purple-100 mb-2">
                    {project.title}
                  </h2>
                  <p className="text-purple-200 text-sm mb-2">
                    {project.description}
                  </p>
                  {project.technologies && (
                    <div className="flex justify-center mt-2">
                      {project.technologies.map((tech, techIndex) => (
                        <div key={techIndex}>{renderIcon(tech.icon)}</div>
                      ))}
                    </div>
                  )}
                  {project.link && (
                    <a
                      href={project.link}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="text-purple-400 hover:text-white mt-2 inline-block"
                    >
                      View Project
                    </a>
                  )}
                </div>
              ))}
            </div>
          )}
        </div>

        {/* Other Projects Section */}
        <div className="mb-10">
          <div
            className="cursor-pointer bg-gray-800 rounded-lg p-4 text-purple-100"
            onClick={() => toggleSection("others")}
          >
            <h2 className="text-2xl font-bold">Projects</h2>
          </div>
          {visibleSections.others && (
            <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6 mt-6">
              {otherProjects.map((project, index) => (
                <div
                  key={index}
                  className="p-4 bg-gray-800 rounded-lg border border-gray-700"
                >
                  <h2 className="text-lg font-bold text-purple-100 mb-2">
                    {project.title}
                  </h2>
                  <p className="text-purple-200 text-sm mb-2">
                    {project.description}
                  </p>
                  {project.technologies && (
                    <div className="flex justify-center mt-2">
                      {project.technologies.map((tech, techIndex) => (
                        <div key={techIndex}>{renderIcon(tech.icon)}</div>
                      ))}
                    </div>
                  )}
                  {project.link && (
                    <a
                      href={project.link}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="text-purple-400 hover:text-white mt-2 inline-block"
                    >
                      View Project
                    </a>
                  )}
                </div>
              ))}
            </div>
          )}
        </div>
      </div>
    </section>
  );
}
